import React from 'react';

function Info(props) {
    return (
        <div className="px-8 py-5">
            <label className="px-4 py-2 bg-gray-600 relative z-10 rounded-l-2xl border text-gray-300 border-gray-400 hover:bg-gray-400 hover:text-gray-100">
                Studen Info
            </label>
        </div>
    );
}

export default Info;
